INSERT INTO Topic (Topic_ID, Topic_Name, Topic_description) VALUES
(1, 'Programming', 'Core programming concepts including OOP, data structures, algorithms, and logic building'),
(2, 'Web Development', 'Frontend and backend development using HTML, CSS, JavaScript, and modern frameworks like React and Node.js'),
(3, 'Data Analysis', 'Exploring, cleaning, and visualizing data using Python, SQL, and tools like Power BI'),
(4, 'Android Development', 'Developing native Android apps using Java, Kotlin, and Firebase'),
(5, 'Graphic Design', 'Design principles, branding, and UI assets using tools such as Adobe Photoshop and Illustrator'),
(6, 'Game Development', 'Creating interactive games with Unity and C# including physics, animation, and game design patterns'),
(7, 'Cybersecurity', 'Protecting systems and data through ethical hacking, network defense, and vulnerability assessment'),
(8, 'Cloud Computing', 'Deploying and managing applications on AWS, Azure, and Google Cloud Platforms'),
(9, 'Artificial Intelligence', 'Developing intelligent systems using machine learning, deep learning, and neural networks'),
(10, 'DevOps', 'Integrating CI/CD, containerization with Docker, and infrastructure automation using tools like Jenkins and Ansible'),
(11, 'Software Testing', 'Manual and automated testing strategies using tools like Selenium, Postman, and JUnit'),
(12, 'Database Management', 'Designing, querying, and optimizing relational and NoSQL databases using SQL, MongoDB, and more'),
(13, 'Networking', 'Understanding computer networks, TCP/IP, routing, switching, and network security protocols'),
(14, 'Embedded Systems', 'Programming microcontrollers and building IoT solutions using C/C++, Arduino, and Raspberry Pi'),
(15, 'Business Intelligence', 'Building dashboards and reports with Power BI, Tableau, and Excel to support decision-making'),
(16, 'UI/UX Design', 'Designing intuitive and user-centered interfaces using Figma, Adobe XD, and usability testing'),
(17, 'Agile & Scrum', 'Applying agile methodologies, Scrum roles, sprints, and backlog refinement in software projects'),
(18, 'Project Management', 'Planning, executing, and monitoring projects using tools like Jira, MS Project, and Trello'),
(19, 'Digital Marketing', 'SEO, content marketing, email campaigns, Google Ads, and social media strategy'),
(20, 'E-Commerce Development', 'Building and managing online stores using Shopify, WooCommerce, and Magento'),
(21, 'Blockchain Technology', 'Understanding blockchain concepts and building smart contracts using Ethereum and Solidity'),
(22, 'Robotics', 'Programming robotic systems with sensors, actuators, and autonomous control algorithms'),
(23, 'Computer Vision', 'Implementing image recognition and object detection using OpenCV and TensorFlow'),
(24, 'Data Engineering', 'Designing and maintaining data pipelines and ETL workflows using Python and Spark'),
(25, 'Quantum Computing', 'Introduction to qubits, quantum gates, and building basic quantum circuits'),
(26, 'Software Architecture', 'Designing scalable software using architecture patterns like MVC, microservices, and event-driven design'),
(27, 'Entrepreneurship', 'Launching and managing startups using lean methodologies, market validation, and business models'),
(28, 'IT Support', 'Providing technical support for hardware, software, and system troubleshooting in enterprise environments'),
(29, 'Operating Systems', 'Understanding OS concepts such as process management, memory allocation, and file systems'),
(30, 'System Analysis & Design', 'Modeling software systems using UML, ER diagrams, and requirement gathering techniques'),
(31, 'Technical Writing', 'Creating user manuals, API documentation, and technical guides with clarity and structure'),
(32, 'Scientific Computing', 'Performing numerical computations and simulations using MATLAB, R, and SciPy'),
(33, 'Mobile UI Design', 'Designing responsive and user-friendly interfaces for Android and iOS mobile apps'),
(34, 'AR/VR Development', 'Building augmented and virtual reality applications using Unity, WebXR, and ARKit/ARCore'),
(35, 'Ethics in Technology', 'Exploring privacy, AI ethics, digital rights, and the social implications of emerging technologies');
